// src/components/OrdemServicoEditar.js
import React, { useState, useEffect } from 'react';

const OrdemServicoEditar = ({ match }) => {
  const [ordem, setOrdem] = useState({
    id: '',
    numero_protocolo: '',
    nome_solicitante: '',
    telefone_solicitante: '',
    data_abertura: '',
    data_agendamento: '',
    tipo_visita: '',
    modalidade: '',
    nome_empresa: '',
    endereco: '',
    problema_reportado: '',
    nome_tecnico: '',
    descricao_servico: '',
    estado_equipamento: '',
    nome_acompanhante: '',
    assinatura_acompanhante: '',
    assinatura_tecnico: '',
    imagens_servico: [],
    data_finalizacao: '',
    status: '',
    comentarios_observacoes: [],
    novo_comentario: '',
  });

  const ordemId = match.params.id;

  // Simulando dados puxados do banco (normalmente viria via API)
  useEffect(() => {
    const ordemDoBanco = {
      id: ordemId,
      numero_protocolo: 'PROTOCOLO123',
      nome_solicitante: 'João Silva',
      telefone_solicitante: '11987654321',
      data_abertura: '2025-05-05',
      data_agendamento: '2025-05-10',
      tipo_visita: 'Técnico',
      modalidade: 'Presencial',
      nome_empresa: 'Hospital Santa Clara',
      endereco: 'Rua A, 123',
      problema_reportado: 'Equipamento não liga',
      nome_tecnico: 'Carlos Souza',
      descricao_servico: '',
      estado_equipamento: '',
      nome_acompanhante: '',
      assinatura_acompanhante: '',
      assinatura_tecnico: '',
      imagens_servico: [],
      data_finalizacao: '',
      status: 'Aguardando Atendimento',
      comentarios_observacoes: [],
      novo_comentario: '',
    };
    setOrdem(ordemDoBanco);
  }, [ordemId]);

  const handleChange = (e) => {
    setOrdem({ ...ordem, [e.target.name]: e.target.value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Ordem atualizada:', ordem);
    alert('Alterações salvas com sucesso!');
  };

  const usuarioLogado = 'Carlos Souza'; // Substituir pelo usuário autenticado

  const handleAddComentario = () => {
    if (ordem.novo_comentario.trim() !== '') {
      const novoComentario = {
        autor: usuarioLogado,
        comentario: ordem.novo_comentario,
        data: new Date().toISOString()
      };
      setOrdem({
        ...ordem,
        comentarios_observacoes: [...ordem.comentarios_observacoes, novoComentario],
        novo_comentario: ''
      });
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h2>Editar Ordem de Serviço</h2>

      {/* Campos informativos vindos do Órbita App */}
      <fieldset disabled>
        <legend>Informações do Órbita App</legend>
        <div><strong>Protocolo:</strong> {ordem.numero_protocolo}</div>
        <div><strong>Solicitante:</strong> {ordem.nome_solicitante}</div>
        <div><strong>Telefone:</strong> {ordem.telefone_solicitante}</div>
        <div><strong>Data Abertura:</strong> {ordem.data_abertura}</div>
        <div><strong>Agendamento:</strong> {ordem.data_agendamento}</div>
        <div><strong>Empresa:</strong> {ordem.nome_empresa}</div>
        <div><strong>Endereço:</strong> {ordem.endereco}</div>
        <div><strong>Problema:</strong> {ordem.problema_reportado}</div>
        <div><strong>Tipo de Visita:</strong> {ordem.tipo_visita}</div>
        <div><strong>Modalidade:</strong> {ordem.modalidade}</div>
        <div><strong>Técnico:</strong> {ordem.nome_tecnico}</div>
      </fieldset>

      {/* Formulário para editar dados */}
      <form onSubmit={handleSubmit}>
        <div>
          <label>Descrição do Serviço:</label>
          <textarea name="descricao_servico" value={ordem.descricao_servico} onChange={handleChange} />
        </div>
        <div>
          <label>Estado do Equipamento:</label>
          <input name="estado_equipamento" type="text" value={ordem.estado_equipamento} onChange={handleChange} />
        </div>
        <div>
          <label>Nome do Acompanhante:</label>
          <input name="nome_acompanhante" type="text" value={ordem.nome_acompanhante} onChange={handleChange} />
        </div>
        <div>
          <label>Assinatura do Acompanhante (Base64 ou arquivo):</label>
          <input name="assinatura_acompanhante" type="text" value={ordem.assinatura_acompanhante} onChange={handleChange} />
        </div>
        <div>
          <label>Assinatura do Técnico (Base64 ou arquivo):</label>
          <input name="assinatura_tecnico" type="text" value={ordem.assinatura_tecnico} onChange={handleChange} />
        </div>
        <div>
          <label>Data de Finalização:</label>
          <input name="data_finalizacao" type="date" value={ordem.data_finalizacao} onChange={handleChange} />
        </div>
        <div>
          <label>Status:</label>
          <select name="status" value={ordem.status} onChange={handleChange}>
            <option value="Aguardando Atendimento">Aguardando Atendimento</option>
            <option value="Em Pendência">Em Pendência</option>
            <option value="Realizado Em Validação">Realizado Em Validação</option>
            <option value="Finalizado">Finalizado</option>
            <option value="Atrasado">Atrasado</option>
          </select>
        </div>

        {/* Comentários */}
        <div>
          <label>Comentários / Observações:</label>
          <textarea
            name="novo_comentario"
            value={ordem.novo_comentario}
            onChange={handleChange}
            placeholder="Adicionar novo comentário..."
          />
          <button type="button" onClick={handleAddComentario}>Adicionar Comentário</button>
          <ul>
            {ordem.comentarios_observacoes.map((c, i) => (
              <li key={i}>
                <strong>{c.autor}</strong> às {new Date(c.data).toLocaleString()}:<br />
                {c.comentario}
              </li>
            ))}
          </ul>
        </div>

        <button type="submit">Salvar Alterações</button>
      </form>
    </div>
  );
};

export default OrdemServicoEditar;
